&lt;p&gt;For each indexRegistration, we want to build an ordered set of itemIds that match the
filter value for that index.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;If there is no active filter for the index, return all indexed itemIds(sorted).&lt;/li&gt;
&lt;li&gt;Eventually we&#39;ll then apply an &quot;intersection&quot; operation to all of the sets to come up with the filtered itemIds&lt;/li&gt;
&lt;li&gt;We need do create results per index so the we can quickly calculate refiner options and counts&lt;/li&gt;
&lt;li&gt;Each refiner requires removing the active refiner from the filter&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;Turns an array of sorted sets of itemIds (per index) into a single array of itemIds&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Applies an &#39;intersection&#39; to the sets to only show items that appear in each index&#39;s filter result&lt;/li&gt;
&lt;li&gt;Handles sorting&lt;/li&gt;
&lt;li&gt;Finds the sorted set associated with the sortKey&lt;/li&gt;
&lt;li&gt;Puts that sorted set first in the intersection operation so it will be used to order the output&lt;/li&gt;
&lt;li&gt;Applies any skip and limit to slice the output&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;For each index registration, calculate the refiner options&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;To calculate refiner options we need to run a filter that omits the active indexFilter&lt;/li&gt;
&lt;li&gt;filterResults is an array of ordered Sets of itemIds (that have been already been filtered)&lt;/li&gt;
&lt;/ul&gt;

